import "./Signup.css";

const Signup = () => {
  return (
    <div className="signup-page">
      <p className="medium-header">SIGNUP</p>
      <form action="#">
        <div className="input-group">
          <input type="text" name="" id="" placeholder="Enter firstname.." />
        </div>
      </form>
    </div>
  );
};

export default Signup;
